import React, { Component } from 'react';


function get() {
  return fetch(`/something`, {
    accept: "application/json"
  })
  .then(response => {
    const result = JSON.parse(response);
    console.log(result); 
    return result
  })
  .then((data) => {
    this.setState({
      message: data
    })
  }).catch(err => console.log(err));
}

class App extends Component {
  constructor(props) {
    super(props);
    this.state = {
      message: ""
    }
  }

  componentDidMount(){
    get();
  }
  render() {
    return (
      <p>
        {this.message}
      </p>
    );
  }
}

export default App;
